import React, { useState } from 'react';
import ReactDOM from "react-dom/client";
// import FullName from './App/components/EjemploEstadosComponents'
// import { Counter } from './App/components/EjemploEstadosComponents/ejemploCicloDeVidaFuntionals';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header from './App/components/header';
import BookPage from './App/pages/BookPage';
import WishListPage from './App/pages/WisListPage';
import BookDetailPage from './App/pages/BookDetailPage';
import LoginPage from './App/pages/LoginPage/LoginPage';
import PruebasPage from './App/pages/PruebasPage';
import Home from './App/pages/Home';
import SkillPage from './App/pages/SkillPage';
import IntroductionPage from './App/pages/IntroductionPage';
import './styles.css'

const App = () => {
    let [isLoading, setIsLoading] = useState(false); // Mover el hook dentro de un componente funcional

    return (
            <Router>
                <Header/>
                <Switch>
                    <Route path="/" exact component={Home} />
                    <Route path="/home" component={Home} />
                    <Route path="/introduction" component={IntroductionPage} />

                    <Route
                        path="/login"
                        render={() => (
                            <LoginPage isLoading={isLoading} setIsLoading={setIsLoading} login={ true } />    
                        )}
                    />
                    <Route
                        path="/register"
                        render={() => (
                            <LoginPage isLoading={isLoading} setIsLoading={setIsLoading} login={ false } />    
                        )}
                    />
                    <Route path="/myWishList" component={WishListPage} /> 
                    <Route path="/books/:id" component={BookDetailPage} /> 
                    <Route path="/books" component={BookPage} /> 
                    <Route path="/pruebas" component={PruebasPage} /> 


                    {/*--------------------------------------------------*/ }

                    <Route path="/skill" component={SkillPage} /> 
                </Switch>
            </Router>
    );
};

ReactDOM.createRoot(document.getElementById('root')).render(<App />); // Renderiza el componente funcional App
